// src/App.js

import React, {Component} from 'react';

class App extends Component {

  state = {
    books: []
  }

  componentDidMount() {
    fetch('http://localhost:8080/books')
        .then(res => res.json())
        .then((data) => {
          this.setState({ books: data })
        })
        .catch(console.log)
  }

  render () {
    return (
        <div class="books">
          <div class="books-body">
            <h5 class="id">Arrays.toString({this.state.books})</h5>




          </div>
        </div>
    );
  }
}

export default App;
